import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './reception.css'
import PersonIcon from '@mui/icons-material/Person';
import NumbersIcon from '@mui/icons-material/Numbers';
import MeetingRoomIcon from '@mui/icons-material/MeetingRoom';
import AllPatients from './allPatients'
const ReceptionQueue = () => {
    const [selectedPatient, setSelectedPatient] = useState(null);
    const [selectedRoom, setSelectedRoom] = useState(""); // Add this line
    const [rooms, setRooms] = useState([
        "קבלה",
        "חדר טיפולים",
        "חדר טריאג",
        "חדר רופא",
        "חדר אקג"
    ]);

    const handleMovePatient = (selectedRoom) => {
        // Implement the logic to move the selected patient to the head of the queue
        console.log(`Move patient ${selectedPatient} to ${selectedRoom}`);
    };

    // const [receptionQueue, setReceptionQueue] = useState([]);

    // useEffect(() => {
    //     const apiUrl = 'http://localhost:3000/receptionQueue';

    //     axios.get(apiUrl)
    //         .then(response => {
    //             setReceptionQueue(response.data);
    //         })
    //         .catch(error => {
    //             console.error('Error fetching reception queue data:', error);
    //         });
    // }, []); 

    // Your sample JSON data
    const sampleQueues = [
        {
            "room": "קבלה"
        },
        {
            "room": "חדר טיפולים"
        }, {
            "room": "חדר טריאג"
        }, {
            "room": "חדר רופא"
        },
        {
            "room": "חדר אקג"
        }]
    const sampleData = [
        {
            "uniqueNumber": "A2",
            "name": "אברהם שלום",
            "roomId": "12fhi23",
            "turnId": 2
        },
        {
            "uniqueNumber": "B1",
            "name": "מרים כהן",
            "roomId": "12fhi23",
            "turnId": 1
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 3
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 4
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 5
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 6
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 7
        }, {
            "uniqueNumber": "A2",
            "name": "אברהם שלום",
            "roomId": "12fhi23",
            "turnId": 8
        },
        {
            "uniqueNumber": "B1",
            "name": "מרים כהן",
            "roomId": "12fhi23",
            "turnId": 9
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 10
        }
    ];
    return (
        <>
            <h2>Reception Queue</h2>
            <div className='patientsTable'>
                <div className='scrollListQueue'>
                    <table>
                        <thead>
                            <tr >
                                <th> שם מטופל</th>
                                <th>מספר</th>
                            </tr>
                        </thead>
                        <tbody>
                            {sampleData.map(item => (
                                <tr key={item.turnId}>
                                    <td>{item.name} </td>
                                    <td>{item.uniqueNumber}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>

            </div>


            <div className='controllBoard'>
                <AllPatients onPatientSelect={setSelectedPatient} />
                <div className='selectedPatientDetails'>
                    <div className='details'>
                        <div className='selPatientDetSection'>
                            <span className='selPatientDetTitles'><PersonIcon /></span>
                            <span>אבי</span>
                        </div>
                        <div className='selPatientDetSection'>
                            <span className='selPatientDetTitles'><NumbersIcon /></span>
                            <span>{selectedPatient}</span>
                        </div>
                        <div className='selPatientDetSection'>
                            <span className='selPatientDetTitles'><MeetingRoomIcon/></span>
                            <span>טיפולים</span>
                        </div>
                        <div className='selPatientDetSection'>
                            <span className='selPatientDetTitles'>מקום מטופל בתור: </span>
                            <span>2</span>
                        </div>

                    </div>


                    <div className="moveToHeadControll">
                        <select className='selectRoom' value={selectedRoom} onChange={(e) => setSelectedRoom(e.target.value)}>
                            <option disabled>בחר חדר</option>
                            {rooms.map((room) => (
                                <option key={room} value={room}>{room}</option>
                            ))}
                        </select>
                        <select className='selectAction'>
                            <option disabled>בחר פעולה</option>
                            <option value="moveToStart">העבר לתחילת התור</option>
                            <option value="moveToEnd">העבר לסוף התור</option>

                        </select>
                        <button className='moveToHeadBtn' onClick={handleMovePatient}>
                            העבר מטופל
                        </button>

                    </div>

                </div>
            </div>
        </>
    );
};

export default ReceptionQueue;
